    "y = encodedDf[['Cancelation']].astype(str)\n",
    "selector =  SelectKBest(chi2, k=7)\n",
    "X_new = selector.fit_transform(X, y)\n",
    "cols = selector.get_support(indices=True)\n",
    "features_df_cat= encodedDf.iloc[:,cols]\n",
    "features_df_cat"
